import { Grid, Box,Paper } from '@mui/material'
import React from 'react'

const Edit_profile = () => {
  return (
    <div>
        <Grid container style={{
            border:'2px solid red'
        }}>
                <Box
      sx={{
        display: 'flex',
        '& > :not(style)': {
          m: 1,
          width: '128vh',
          height: '128vh',
        },
      }}
    >
      <Paper variant="outlined" />
      <Paper variant="outlined" square />
    </Box>

        </Grid>
    </div>
  )
}

export default Edit_profile
